        <label>Body</label>
        <textarea type="textarea"></textarea>

        <label>Author</label>
        <select>
          <option value="mario">mario</option>
          <option value="yoshi">yoshi</option>
        </select>
      </form>
    </div>
  );
};

export default Create;
